import React from 'react'
import img from "./../images/drapeau_MLG.png"
import CardPlace from './CardPlace'

function PopularPlace() {
  return (
    <div id='PopularPlace'>
      <CardPlace 
        img={img}
        lieu={"Ankorondrano"}
        nomHotel={"IBIS hotêl"}/>
    </div>
  )
}

export default PopularPlace
